import React from 'react'
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Link from '@mui/material/Link';
import Avatar from '@mui/material/Avatar';
import Typography from '@mui/material/Typography'

//       flexGrow: 1 هتاخذمساحه كبيرة ناحية الشمال 

export default function Navbar() {


  return (
    <>
  <Box sx={{ flexGrow: 1 }}>
      <AppBar position="static">
        <Toolbar>

        <Link href='/' 
        color='inherit' 
        sx={{flexGrow:1 , "&:hover" : {fontSize:"20px" , color:"white"  }}} 
        underline="none"> 
        My expenses </Link>
         <Typography mr={2} variant="body1" color=" inherit">Mariam Mohamed</Typography> 
      <Avatar alt="Mariam Mohamed" src="../../../public/images/unnamed.jpg"/>
        </Toolbar>
      </AppBar>
    </Box>

    
    
    
    
    </>
  )
}
